function _getCookie(cname) {
  var name = cname + "=";
  var decodedCookie = decodeURIComponent(document.cookie);
  var ca = decodedCookie.split(';');
  for(var i = 0; i <ca.length; i++) {
      var c = ca[i];
      while (c.charAt(0) == ' ') {
          c = c.substring(1);
      }
      if (c.indexOf(name) == 0) {
          return c.substring(name.length, c.length);
      }
  }
  if (cname == 'user_id') {
    return _getSession('user_id');
  }
  return "";
}
$(function () {
$('#blog-comment').autogrow({vertical: true, horizontal: false, height: 200});

});
var _shortcut_helper = _getCookie("shortcut_helper");
if ( _shortcut_helper == "false" ) {
  $('#shortcut_helper').hide();
}

function Wo_CloseLightbox() {
  $('.lightbox-container').remove();
  document.body.style.overflow = 'auto';
}

const nav = document.querySelector(".nav");
window.addEventListener("scroll", fixNav);
function fixNav(){
	if(window.scrollY > nav.offsetHeight + 150) {
		nav.classList.add("active");
	}else{
		const presentations = document.getElementById('luis_presentations');
		if(presentations){
			nav.classList.remove("active");
		}else{
			nav.classList.add("active");
		}
	}
}
const tembox = document.querySelector('.luis_slid_open_box');
if (tembox){
	$('body').css({'margin-top': tembox.offsetHeight+'px'});
}else{
	$('body').css({'margin-top': 0+'px'});
}
$(document).on('click','.luis_menu_mobil', () => {
	$('.luis_menu_mobil').toggleClass('avtive_option_mob');
	$('.luis_menu_mobil_container').toggleClass('activadomenumobil');
	$('.menu_mobil_line').toggleClass('activadomenu');
	$('.luis_menu_six').toggleClass('hover_menu_mobil');
	$('li').on('click', () => {
		$('.luis_menu_mobil').removeClass('avtive_option_mob');
		$('.luis_menu_mobil_container').removeClass('activadomenumobil');
		$('.menu_mobil_line').removeClass('activadomenu');
		$('.luis_menu_six').removeClass('hover_menu_mobil');
	});
	$('.luis_menu_six').on('click', () => {
		$('.luis_menu_mobil').removeClass('avtive_option_mob');
		$('.luis_menu_mobil_container').removeClass('activadomenumobil');
		$('.menu_mobil_line').removeClass('activadomenu');
		$('.luis_menu_six').removeClass('hover_menu_mobil');
	});
});
function Wo_UpdateLocation(position) {
  if (!position) {
    return false;
  }
  $.post(Wo_Ajax_Requests_File() + '?f=save_user_location', {lat: position.coords.latitude, lng:position.coords.longitude}, function(data, textStatus, xhr) {
    if (data.status == 200) {
      return true;
    }
  });
  return false;
}

var bodyalto = $(window).height();
